import '../App.css';
import { Button } from './button';
import './hero.css';

//import Video from '/mnt/Backup/../videos/video-1.mp4';


function hero() {
  return (
    <div className='hero-container'>
      <video src='/videos/video-1.mp4' autoPlay loop muted />

      <p>software engineer<br/><br/><br/><br/><br/><br/><br/><br/><br/>
      <br/><br/><br/><br/><br/><br/><br/><br/>
      &emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;&emsp;test</p>
    </div>
  );
}

export default hero;
